// import Carousel from 'react-bootstrap/Carousel';
import Schedule from './Schedule';
import './Home.css';
// import Memories from '../Memories/Memories';
import { details } from '../../file1';
import SimpleCard from '../Memories/SimpleCard';
function Home() {
    return (
        <div className='home'>
            <div className='content'>
            </div>
            <div className='main'>
                <SimpleCard props={details} />
            </div>
            <div className='schedule' style={{ marginTop: '30px' }}>
                <Schedule />
            </div>
        </div>
    )
}
export default Home
